export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},WS6lJrBFIc:{data:{id:2257,attributes:{imdbId:"tt1686821",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BM2E1YzA0NTItNTNjYS00OGUxLTg4ZWUtYmYyNDQwMGViZjJmXkEyXkFqcGdeQXVyNzQ5MzY0NjM@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"},{Source:"Rotten Tomatoes",Value:"16%"},{Source:"Metacritic",Value:"31\u002F100"}],item_lang:{data:{id:2920,attributes:{title:e,plot:"Rose Hathaway is a dhampir, half-vampire and half-human, who is training to be a guardian at St Vladimir's Academy along with many others like her. There are good and bad vampires in their world: Moroi, who co-exist peacefully among the humans and only take blood from donors, and also possess the ability to control one of the four elements - water, earth, fire or air; and Strigoi, blood-sucking, evil vampires who drink to kill. Rose and other dhampir guardians are trained to protect Moroi and kill Strigoi throughout their education. Along with her best friend, Princess Vasilisa Dragomir, a Moroi and the last of her line, with whom she has a nigh unbreakable bond, Rose must run away from St Vladimir's, in order to protect Lissa from those who wish to harm the princess and use her for their own means.",slug:"vampire-academy"}}},books:{data:[{id:11043,attributes:{title:e,description:"St Vladimir's Academy isn't just any boarding school - hidden away, it's a place where vampires are educated in the ways of magic and half-human teens train to protect them. Rose Hathaway is a Dhampir, a bodyguard for her best friend Lissa, a Moroi Vampire Princess. They've been on the run, but now they're being dragged back to St Vladimir's where the girls must survive a world of forbidden romances, a ruthless social scene and terrifying night time rituals. But most of all, staying alive.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lvTaAURAdegC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2009-05-26",publisher:"Penguin UK",subtitle:c}},{id:11044,attributes:{title:"Vampire Academy Box Set 1-6",description:"Enter the complete saga of the international #1 bestselling Vampire Academy series by Richelle Mead—soon to be a major motion picture! Lissa Dragomir is a Moroi princess: a mortal vampire with an unbreakable bond to the earth’s magic. The powerful blend of human and vampire blood that flows through Rose Hathaway, Lissa’s best friend, makes her a Dhampir. Rose is dedicated to a dangerous life of protecting Lissa from the Strigoi, who are hell-bent on making her one of them. Rose and Lissa must navigate through this dangerous world, confront the temptation of forbidden romance, and never once let their guard down, lest the Strigoi make Lissa one of them forever.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kxhAnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2013-12-31",publisher:"Razorbill",subtitle:c}},{id:11045,attributes:{title:"Vampire Academy Collection",description:"After running away, vampire princess Lissa and her guardian Rose are returned to St. Vladimir's Academy, where they deal with high school, boys, protecting Lissa from the evil Strigoi, and staking the vampire Dimitri, a boy Rose loves.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aVLHbwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2010-10-14",publisher:c,subtitle:"Vampire Academy \u002F Frostbite \u002F Shadow Kiss \u002F Blood Promise"}},{id:11046,attributes:{title:e,description:"The story that kicked off the international #1 bestselling Vampire Academy series. St. Vladimir’s Academy isn’t just any boarding school—it’s a hidden place where vampires are educated in the ways of magic and half-human teens train to protect them. Rose Hathaway is a Dhampir, a bodyguard for her best friend Lissa, a Moroi Vampire Princess. They’ve been on the run, but now they’re being dragged back to St. Vladimir’s—the very place where they’re most in danger. . . . Rose and Lissa become enmeshed in forbidden romance, the Academy’s ruthless social scene, and unspeakable nighttime rituals. But they must be careful lest the Strigoi—the world’s fiercest and most dangerous vampires—make Lissa one of them forever.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AHpEoxYiK9AC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2007-08-16",publisher:h,subtitle:c}},{id:11047,attributes:{title:"Frostbite",description:"Rose loves Dimitri, Dimitri might love Tasha, and Mason would die to be with Rose… It’s winter break at St. Vladimir’s, but Rose is feeling anything but festive. A massive Strigoi attack has put the school on high alert, and now the Academy’s crawling with Guardians—including Rose’s hard-hitting mother, Janine Hathaway. And if handto- hand combat with her mom wasn’t bad enough, Rose’s tutor Dimitri has his eye on someone else, her friend Mason’s got a huge crush on her, and Rose keeps getting stuck in Lissa’s head while she’s making out with her boyfriend, Christian! The Strigoi are closing in, and the Academy’s not taking any risks.... This year, St. Vlad’s annual holiday ski trip is mandatory. But the glittering winter landscape and the posh Idaho resort only create the illusion of safety. When three friends run away in an offensive move against the deadly Strigoi, Rose must join forces with Christian to rescue them. But heroism rarely comes without a price…",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HYzIFHuhaZwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2008-04-10",publisher:h,subtitle:"A Vampire Academy Novel"}}]}}},meta:{}}},prerenderedAt:1681309577407}}("Richelle Mead","movie","",null,"Vampire Academy","series",1,"Penguin"))